**Digital Problem Solving Competence** involves knowing where to find help with digital challenges and understanding how to improve digital competencies.



::: {.cell}

:::



## {{< iconify ph lightning-fill >}} Problem Solving Skills


**Skills** measures participants’ *self-assessed ability* to perform a wide range of digital tasks. These items capture how confident people feel doing things like searching for information.


::: {.cell}
::: {.cell-output-display}

